import React from 'react'

export default function Homepage(){
    return(
        <div className='container' >
            <div className='row' style={{backgroundColor: '#FF200'}}>
                <div className='col-md-6 offset-md-3 my-5'>
                    <h1 className='text-center mt-5 ' style={{color:'navy'}}>Pronadji putovanje za sebe!</h1>
                </div>
            </div>
        </div>
    );
}
